def can_provide_correct_change(bills: list[int]) -> bool:
    bill_count = {5: 0, 10: 0, 20: 0}
    for bill in bills:
        if bill == 5:
            bill_count[5] += 1
        elif bill == 10:
            if bill_count[5] > 0:
                bill_count[10] += 1
                bill_count[5] -= 1
            else:
                return False
        elif bill == 20:
            if bill_count[10] > 0 and bill_count[5] > 0:
                bill_count[20] += 1
                bill_count[10] -= 1
                bill_count[5] -= 1
            elif bill_count[5] >= 3:
                bill_count[20] += 1
                bill_count[5] -= 3
            else:
                return False
    return False

